import React, { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [counter, setCounter] = useState(0);

  function addition() {
    setCounter((oldValue) => {
      counter = oldValue + 1;
    });
  }

  function subtraction() {
    setCounter((oldValue) => {
      counter = oldValue + 1;
    });
  }

  return (
    <body className="App-body">
      <div>
        <button onClick={addition}>Add</button>
        {counter}
        <button onClick={subtraction}>Subtract</button>
      </div>
      <div id="array"></div>
    </body>
  );
}

export default App;
